  //METHODS

  @override
  void initState() {
    super.initState();

    seriesList = _createSampleData();
  }

  List<TimeSeriesData> generateTimeSeriesDataList() {
    List<TimeSeriesData> data = [];

    for (int i = 0; i < tsList.length; i+=1) {
      DateTime dateTime = DateTime.parse(tsList[i]);
      data.add(TimeSeriesData(dateTime, axList[i]));
    }

    return data;
  }

  List<charts.Series<TimeSeriesData, DateTime>> _createSampleData() {
    final data = generateTimeSeriesDataList();

    return [
      charts.Series<TimeSeriesData, DateTime>(
        id: 'Sample',
        colorFn: (_, __) => charts.ColorUtil.fromDartColor(Colors.indigo),
        domainFn: (TimeSeriesData data, _) => data.time,
        measureFn: (TimeSeriesData data, _) => data.value,
        data: data,
      )
    ];
  }

  String formatDuration(int totalSeconds) {
    final duration = Duration(seconds: totalSeconds);
    final minutes = duration.inMinutes;
    final seconds = totalSeconds % 60;

    final minutesString = '$minutes'.padLeft(1, '0');
    final secondsString = '$seconds'.padLeft(2, '0');
    return '$minutesString:$secondsString';
  }

